import React, { Component } from "react";

class TechnicalStuff extends Component {
  render() {
    return (
      <div>
        <p className="comment">
          // the technical stuff
          ------------------------------------------------------------------------------------------
        </p>
        <p>{"<div id='experience'>"}</p>
        <p className="paragraph">
          <p>{"<p class='coursework'>"}</p>
          <p className="paragraphBody">
            some of my coursework includes Algorithmic Game Theory, Computer
            Architecture, Operating Systems, Data Structures and Algorithms,
            Scalable and Cloud Computing, Databases and Information Systems,
            Software Design, Discrete Mathematics, Number Theory, as well as
            Automata, Computability, and Complexity.
          </p>
          <p>{"</p>"}</p>
          <p>{"<p class='technical experience'>"}</p>
          <p className="paragraphBody"></p>
          <p>{"</p>"}</p>
        </p>
        <p>{"</div>"}</p>
      </div>
    );
  }
}

export default TechnicalStuff;
